(()=>{"use strict";function e(e){return e>=0&&e<=60&&e%100<10?"0"+e:e}(t=>{const n=document.getElementById("timer-hours"),o=document.getElementById("timer-minutes"),m=document.getElementById("timer-seconds"),r=()=>{let t=(()=>{let e=(new Date("06 december 2021").getTime()-(new Date).getTime())/1e3;return{timeRemaining:e,hours:Math.floor(e/60/60),minutes:Math.floor(e/60%60),seconds:Math.floor(e%60)}})();t.timeRemaining<0?(clearInterval(r),n.textContent="00",o.textContent="00",m.textContent="00"):(n.textContent=e(t.hours),o.textContent=e(t.minutes),m.textContent=e(t.seconds))};setInterval(r,1e3)})()})();